import {APP_ID, CONTEXT, DE, EN, FR, IT, LAST_CALL, STAGE, TEXT_ID} from "../utils/constants";
import {TableRow} from "material-ui";
import {TableCell, TableHead} from "@material-ui/core";

export default function CustomTableHead() {

    const headCells = [
        {id: APP_ID, label: 'App-ID *'},
        {id: CONTEXT, label: 'Kontext *'},
        {id: TEXT_ID, label: 'Text-ID *'},
        {id: STAGE, label: 'Stage *'},
        {id: DE, label: 'Deutsch'},
        {id: FR, label: 'Französisch'},
        {id: IT, label: 'Italienisch'},
        {id: EN, label: 'Englisch'},
        {id: LAST_CALL, label: 'Letzter Aufruf'}
    ];

    function mapHeadCellToTableCell() {
        return(
            <TableCell className={"tableHeadField"}></TableCell>
        )
    }

    return(
        <TableHead className={"tableHead"}>
            <TableRow>
                {headCells.map(headCell => mapHeadCellToTableCell(headCell))}
                <TableCell/>
                <TableCell/>
            </TableRow>
        </TableHead>
    );
}
